
window.evergageBeforeSiteConfigExecution = function() {
    try {
if (window.sessionStorage) {
    if (window.sessionStorage.AccountNumber) {
        Evergage.setUser(window.sessionStorage.AccountNumber);
    }
    if (window.sessionStorage.FirstName) {
        Evergage.setCustomField("firstName", window.sessionStorage.FirstName, Evergage.Scope.Request);
    }
    if (window.sessionStorage.loyaltyPoints) {
        Evergage.setCustomField("loyaltyPoints", window.sessionStorage.loyaltyPoints, Evergage.Scope.Request);
    }
}

var device_id = ajq.cookie("wu_device_id");
if (device_id) {
    Evergage.setCustomField("device_id", device_id, Evergage.Scope.Request);
}

if (/\/?send\-money/.test(window.location.pathname)) {
    var lastCurrency = ajq.cookie("lastCurrency");
    var lastFundsIn = ajq.cookie("lastFundsIn");
    var lastSendAmount = ajq.cookie("lastSendAmount");
    var lastFundsOut = ajq.cookie("lastFundsOut");
    var transferFeeAmount = ((window.analyticsObject || {}).sc_txn_fee || {});

    if (lastCurrency) Evergage.setCustomField("lastCurrency", lastCurrency, Evergage.Scope.Request);
    if (lastFundsIn) Evergage.setCustomField("lastFundsIn", lastFundsIn, Evergage.Scope.Request);
    if (lastSendAmount) Evergage.setCustomField("lastSendAmount", lastSendAmount, Evergage.Scope.Request);
    if (lastFundsOut) Evergage.setCustomField("lastFundsOut", lastFundsOut, Evergage.Scope.Request);
    if (!ajq.isEmptyObject(transferFeeAmount)) Evergage.setCustomField("transferFeeAmount", transferFeeAmount, Evergage.Scope.Request);
}

if (/^\/[a-zA-Z]{2}\/[a-zA-Z]{2}\/account\/app\/profile/.test(Evergage.util.getPathnameFromLocation(window.location))) {
    Evergage.util.runWhenReady(
        function () {
            return ajq("#profileInfoForm").length > 0;
        },
        function () {
            Evergage.safeClick("#save-profileaddr-btn, #save-profile-btn", function (e) {
                Evergage.util.runWhenReady(
                    function () {
                        return window.sessionStorage && window.sessionStorage.profileUpdatedSuccessfully === "true";
                    },
                    function () {
                        Evergage.trackAction("Profile Updated Successfully");
                    }
                );
            });
        }
    );
}
if (/^\/[a-zA-Z]{2}\/[a-zA-Z]{2}\/send-money\/app\/review/.test(Evergage.util.getPathnameFromLocation(window.location))) {
    Evergage.util.runWhenReady(
        function () {
            return window.sessionStorage && window.sessionStorage.profileUpdatedSuccessfully === "true";
        },
        function () {
            Evergage.trackAction("Profile Updated Successfully");
        }
    );
}

Evergage.meta = (function() {
    "use strict";

    return {
        validateAndTrimItem: function(item, noId) {

            if (typeof item !== "object") return false;

            for (var k in item) {
                if ((item.hasOwnProperty(k)) && (typeof item[k] == "string")) {
                    item[k] = ajq.trim(item[k]);
                    if (item[k] === "") {
                        Evergage.sendException(new Error("Empty string for item attribute: " + k), "Site-wide JavaScript");
                        item[k] = null;
                    }
                }
                if (k == "url" || k == "imageUrl") {
                    item[k] = Evergage.util.qualifyUrl(item[k]);
                }
            }

            if (typeof item._id == "number") {
                item._id = item._id.toString();
            }

            if (!item._id && !noId) {
                Evergage.sendException(new Error("Invalid item id."), "Site-wide JavaScript");
                return false;
            }

            if (item.type == Evergage.ItemType.Tag) {
                if (!(item.tagType == "Brand" ||
                        item.tagType == "Gender" ||
                        item.tagType == "ItemClass" ||
                        item.tagType == "Style" ||
                        item.tagType == "Author" ||
                        item.tagType == "Keyword" ||
                        item.tagType == "ContentClass")) {
                    Evergage.sendException(new Error("Invalid tag type."), "Site-wide JavaScript");
                    return false;
                }
            } else if (!(item.type == Evergage.ItemType.Product ||
                    item.type == Evergage.ItemType.Category ||
                    item.type == Evergage.ItemType.Article ||
                    item.type == Evergage.ItemType.Blog)) {
                Evergage.sendException(new Error("Invalid item type"), "Site-wide JavaScript");
                return false;
            }

            var isValid = true;

            if (item.tags) {
                for (var i = 0; i < item.tags.length; i++) {
                    isValid = isValid && Evergage.meta.validateAndTrimItem(item.tags[i]);
                }
            }

            if (item.categories) {
                for (var j = 0; j < item.categories.length; j++) {
                    isValid = isValid && Evergage.meta.validateAndTrimItem(item.categories[j]);
                }
            }

            return isValid;

        },

        validateLineItem: function(lineItem, isOrder) {
            if (lineItem.sku && !lineItem.sku.id) {
                if (isOrder) {
                    lineItem.sku = null;
                } else {
                    return false;
                }
            }
            var noId = (lineItem.sku && !lineItem.item._id) ? true : false;
            return (Evergage.meta.validateAndTrimItem(lineItem.item, noId) && lineItem.quantity > 0 && typeof(lineItem.item.price) == "number");
        },

        validateOrder: function(order) {
            var isValid = true;
            if (order.lineItems) {
                if (order.lineItems.length == 0) return false;
                for (var i = 0; i < order.lineItems.length; i++) {
                    isValid = isValid && Evergage.meta.validateLineItem(order.lineItems[i], true);
                }
            } else {
                return false;
            }

            if (typeof order.orderId == "string") {
                order.orderId = ajq.trim(order.orderId);
                if (order.orderId === "") {
                    Evergage.sendException(new Error("Empty string for order Id"), "Site-wide JavaScript");
                    order.orderId = null;
                }
            }

            return isValid;
        },

        getArticleContent: function(metaTag) {
            var tag = ajq("meta[property='article:" + metaTag + "']:first");

            if (tag.length > 0) {
                return ajq.trim(tag.attr("content"));
            } else {
                return null;
            }
        },

        detectProduct: function() {

            var product = {
                type:               Evergage.ItemType.Product,
                _id:                Evergage.meta.detectCountry()
            };

            return product;
        },

        buildOrder: function() {

            var jsonObj = JSON.parse((window.sessionStorage || {}).SummaryObjects || "{}");

            var order = {
                lineItems:              [],
                totalValue:             Evergage.util.getCurrencyValue(((jsonObj || {}).transaction_total)) || Evergage.util.getCurrencyValue(ajq(".review-summary-total-amount").first().text())
            };

            if ((window.analyticsObject || {}).sc_mtcn) {
                order.orderId = window.analyticsObject.sc_mtcn;
            }

            var sendingMethod = (window.sessionStorage || {}).wuAmplitudeSMO_fundsIn;
            var receivingMethod = (window.sessionStorage || {}).wuAmplitudeSMO_fundsOut;

            if (sendingMethod ) {
                var sendingItem = {
                    type:               Evergage.ItemType.Product,
                    _id:                sendingMethod + " - Fund In",
                    price:              Evergage.util.getCurrencyValue((jsonObj || {}).transfer_fee) || Evergage.util.getCurrencyValue(ajq(".review-summary-item:contains('fee') ~ .trxn-amount").first().text()) || .0001
                };
                order.lineItems.push({item: sendingItem, quantity: 1});

            }

            if (receivingMethod) {
                var receivingItem = {
                    type:               Evergage.ItemType.Product,
                    _id:                receivingMethod + " - Fund Out",
                    price:              .0001
                };
                order.lineItems.push({item: receivingItem, quantity: 1});
            }


            var transferAmount = Evergage.util.getCurrencyValue((jsonObj || {}).transfer_amount) || Evergage.util.getCurrencyValue(ajq(".review-summary-item:contains('Transfer amount') ~ .trxn-amount").first().text());

            if (transferAmount) {

                var item = {
                    type:               Evergage.ItemType.Product,
                    _id:                (jsonObj || {}).country_name || ajq.trim(ajq(".tansfer-details .review-h2").first().text()),
                    price:              transferAmount
                };

                var quantity = 1;

                order.lineItems.push({item: item, quantity: quantity});
                Evergage.setCustomField("lastSentCountry", item._id, Evergage.Scope.Request);
            }

            return order;
        },

        detectCountry: function() {
            var flagNode =  ajq(".wu-field span[class*='flag-icon-']:not(span.flag-icon-default):visible, .smo-receiver-dropdown-container [class*='flag-icon-']:not(span.flag-icon-default):visible");
            var flagCheck = (window.sessionStorage || {}).wuAmplitudeSMO_receiverCountry || Evergage.util.extractFirstGroup(/flag-icon-(?!default|position)([a-zA-Z]{2})\b/, flagNode.first().attr('class'));

            if (flagCheck && flagCheck.length > 1 && flagCheck.length < 4) {
                if (window.fundsInOptions && window.fundsInOptions[flagCheck.toUpperCase()] && window.fundsInOptions[flagCheck.toUpperCase()].name) {
                    var country = ajq.trim(window.fundsInOptions[flagCheck.toUpperCase()].name);
                    return country;
                } else if (window.fundsOutOptions && window.fundsOutOptions[flagCheck.toUpperCase()] && window.fundsOutOptions[flagCheck.toUpperCase()].name) {
                    var country = ajq.trim(window.fundsOutOptions[flagCheck.toUpperCase()].name);
                    return country;
                }
            }

            return false;
        },

        storeFundsInfo: function(view) {
            var delayInMilliseconds = 800;

            setTimeout(function() {
                var funds = [];
                var wuThumbnails = ajq(".wu-thumbnail.wu-thumbnail-selected");

                var fundsOut = (window.sessionStorage || {}).wuAmplitudeSMO_fundsOut;
                var fundsIn = (window.sessionStorage || {}).wuAmplitudeSMO_fundsIn;

                if (fundsOut && fundsIn) {
                    var wuFundOut = {
                        type:               Evergage.ItemType.Product,
                        _id:                fundsOut + " - Fund Out",
                        price:              Evergage.util.getCurrencyValue(ajq(".wu-thumbnail.wu-thumbnail-selected[class*='wu-payout']").eq(0).find("span[id*='TransferFee_']").first().text()) || .0001
                    };
                    funds.push(wuFundOut);
                    if (view) {
                        Evergage.viewItemDetail(wuFundOut, {".noCampaigns" : "true"});
                        window.evgFundOut = fundsOut;
                    }

                    var wuFundIn = {
                        type:               Evergage.ItemType.Product,
                        _id:                fundsIn + " - Fund In",
                        price:              Evergage.util.getCurrencyValue(ajq(".wu-thumbnail.wu-thumbnail-selected[class*='wu-payin']").eq(0).find("span[id*='TransferFee_']").first().text()) || .0001
                    };
                    funds.push(wuFundIn);
                    if (view) {
                        Evergage.viewItemDetail(wuFundIn, {".noCampaigns" : "true"});
                        window.evgFundOut = fundsOut;
                    }
                }

                return funds;
            });
        },

        handlePage: function() {

            if (/\/?send\-money/.test(window.location.pathname)) {

                var product;
                var price = Evergage.util.getCurrencyValue(ajq("#txtSendAmount").val());
                var funds = [];
                var currentCountry;
                var changeCountry = Evergage.safeInterval(function() {
                    var country = Evergage.meta.detectCountry();
                    if (ajq(".spinner-container:visible").length === 0 && ((ajq("#country").length > 0 && ajq("#country").val() !== "") &&
                    country)) {

                        product = Evergage.meta.detectProduct();

                        if (Evergage.meta.validateAndTrimItem(product) && product._id && product._id.length > 3 && currentCountry !== country) {
                            Evergage.setCustomField("lastSelectedCountry", product._id, Evergage.Scope.Request);
                            Evergage.viewItem(product);
                            currentCountry = country;
                        }

                        return true;
                    } else {
                        return false;
                    }
                }, 1000);

                var pageFlag = false;
                Evergage.util.runWhenReady(function() {
                    return (ajq(".wu-thumbnail.wu-thumbnail-selected").length > 0);
                }, function() {

                    Evergage.safeClick("body", function (e) {
                        if (ajq(e.target).closest(".wu-thumbnail-section, .wu-thumbnail-footer").length > 0) {
                            var funds = Evergage.meta.storeFundsInfo(true);
                        } else if (ajq(e.target).closest(".btn-primary:contains('Continue')").length > 0) {

                            if (window && window.analyticsObject && window.analyticsObject.sc_principal) {
                                price = Evergage.util.getCurrencyValue(window.analyticsObject.sc_principal);
                            }

                            if (product && !pageFlag) {
                                product.price = price;

                                var lineItem = {
                                    item:               product,
                                    quantity:           1
                                };

                                if (Evergage.meta.validateLineItem(lineItem)) {
                                    Evergage.setCustomField("lastSelectedCountry", product._id, Evergage.Scope.Request);
                                    Evergage.addToCart(lineItem);
                                }

                                var fundsOut = (window.sessionStorage || {}).wuAmplitudeSMO_fundsOut;
                                var fundsIn = (window.sessionStorage || {}).wuAmplitudeSMO_fundsIn;

                                var funds = [];
                                if (fundsOut && fundsIn) {
                                    var wuFundOut = {
                                        type:               Evergage.ItemType.Product,
                                        _id:                fundsOut + " - Fund Out",
                                        price:              Evergage.util.getCurrencyValue(ajq(".wu-thumbnail.wu-thumbnail-selected[class*='wu-payout']").eq(0).find("span[id*='TransferFee_']").first().text()) || .0001
                                    };
                                    funds.push(wuFundOut);

                                    var wuFundIn = {
                                        type:               Evergage.ItemType.Product,
                                        _id:                fundsIn + " - Fund In",
                                        price:              Evergage.util.getCurrencyValue(ajq(".wu-thumbnail.wu-thumbnail-selected[class*='wu-payin']").eq(0).find("span[id*='TransferFee_']").first().text()) || .0001
                                    };
                                    funds.push(wuFundIn);
                                    Evergage.trackAction("Continue - " + fundsIn);
                                }

                                for (var i = 0; i < funds.length; i++) {
                                    var fund = funds[i];
                                    if (fund._id) {
                                        var lineItem = {
                                            item:               fund,
                                            quantity:           1
                                        };
                                        if (Evergage.meta.validateLineItem(lineItem)) {
                                            Evergage.addToCart(lineItem);
                                        }
                                    }
                                }
                            }
                            pageFlag = true;
                        }
                    });

                }, 500, 20);

            } else if (/\/?send\-money\/app\/receipt/.test(window.location.pathname) && ajq(".receipt-container").length > 0) {

                var order = Evergage.meta.buildOrder();
                if (Evergage.meta.validateOrder(order)) {
                    if ((window.analyticsObject || {}).sc_txn_status) {
                        Evergage.setCustomField("transactionStatus", window.analyticsObject.sc_txn_status, Evergage.Scope.Request);
                    }
                    Evergage.purchase(order);
                }

            }

            Evergage.util.runWhenReady(function() {
                return (((window.analyticsObject || {}).sc_register_success === 'true') || ((window.analyticsObject || {}).sc_loginsuccess === 'true'));
            }, function() {
                if ((window.analyticsObject || {}).sc_register_success === 'true') {
                    Evergage.setCustomField("registerSuccess", "true", Evergage.Scope.Request);
                    Evergage.trackAction("Register Success");
                } else if ((window.analyticsObject || {}).sc_loginsuccess === 'true') {
                    Evergage.setCustomField("loginSuccess", "true", Evergage.Scope.Request);
                    if (window.sessionStorage) {
                        if (window.sessionStorage.AccountNumber) {
                            Evergage.setUser(window.sessionStorage.AccountNumber);
                        }
                    }
                    Evergage.trackAction("Login Success");
                }

            }, 500, 20);
        }

    };
})();

Evergage.meta.handlePage();
    } catch (e) {
        if (typeof window.Evergage === "object" && typeof window.Evergage.getVersion === "function" && window.Evergage.getVersion() >= 5) {
            Evergage.sendException(e, "siteWideJavascript");
        }
    }
};


